import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class ExampServiceService {

  constructor(private _httpClient:HttpClient) { }

  public createApis(datas:any){
      this._httpClient.post('https://jsonplaceholder.typicode.com/posts',datas);
  }
}
